人気急上昇！！<br><br>

3馬力25Lとハイパワー！！<br><br>

ドーナツ型エアーコンプレッサーです！<br><br>

こんな形みたことない！！<br><br>

コンパクト設計で場所も取らず<br><br>

持ち運びが出来るのでとても重宝します。<br><br>


<img src="http://www.rakuten.ne.jp/gold/milkvetch/img/lp/pc/diy/compressor/073d9.jpg"><br>
●電源／100V 50/60Hz <br>
●圧力調整範囲／0～0.8Mpa(0～0.8kgf/cm2） <br>
●電流／12/14A <br>
●安全弁設定圧力／0.88Mpa(8.8kgf/cm2) <br>
●消費電力／2100W <br>
●重量／20ｋｇ <br>
●タンク容量／25L<br>
●コード長さ／1.5m<br>
●回転数／2850/3450r/min <br>
●本体サイズ／高さ630×長さ400×幅400（mm） <br>
●吐出量／120/140L <br>
●生産国／中国 <br>
●空気接続口／1/4カプラー×1<br>
●説明書／付属（英語もしくは中国語） <br>
●最高仕様圧力／0.8Mpa(8kgf/cm2） <br>
●再起動圧力／0.6Mpa(6kgf/cm2)<br><img src="http://image.rakuten.co.jp/milkvetch/cabinet/conpure.jpg" alt="コンプレッサー" width="500" height="200"></p>
<p>他のタイプのコンプレッサーはこちら</p>


●急な在庫切れによりご希望のカラーにお応えできない場合がございます。
ご了承のほどよろしくお願いいたします。

<p>こちらの商品はコンピューター塗装につき、内部の塗装が乾くまでお時間がかかる場合がございます。<br>
初期動作時やドレンを開ける際には十分ご注意下さい。<br>
（塗装に関する二次的損害は保証対象外です）<br>
また、塗装などにご使用される場合は乾燥レギュレーターのご使用をお勧めいたします。</p>


<p>●輸入品について<br>
輸送中のトラブルで動作不具合等が起こる場合もございます。<br>
日本語の取り扱い説明書が無い商品も多数御座いますので、事前にご確認をお願いいたします。<br>
箱・商品に製造時や輸送時に付いてしまったとみられる多少のキズ・凹み・曲がり・汚れがある場合がありますが、本来の性能に異常がない場合は一切対応出来ません。<br>
予告なく多少のデザイン・色・仕様が変わってしまう場合があります。<br>
※ショッピングガイドを必ずご確認ください。</p><img src="http://www.rakuten.ne.jp/gold/milkvetch/img/shoppingguide.jpg" alt="ショッピングガイド" width="517" height="138" />

<p>●配送業者について<br>
当店は全国最安値を実現する為に、配送業者を場所によって指定させて頂いております。<br>
配送業者によってはサービスに差がある場合も御座いますが、お客様のご協力とご理解をどうぞ宜しくお願いいたします。</p><style type="text/css">
